window.bookSummaryJSON = "<p>Michelle Bishop has spent most of her life hating her nemesis, Georgia Beauregard. When the town beauty queen herself suddenly dies, Michelle is the only one who isn't mourning. But Michelle has just discovered there is something far worse than a living, breathing bully. Try being haunted by a dead one.</p> <p>As Michelle and Georgia try to figure out their newfound supernatural connection, a murder rocks the peaceful community of Carder Bluff, Arkansas. Now, the ghost of the victim is also appearing to Michelle. It seems she and Georgia are the only ones who can help send this poor, annoying soul on his way. Can these two enemies learn to put aside their differences to solve a murder in their hometown?</p>"; 
